import { useState, useEffect } from "react";

function ScheduleList(props) {
  console.log("length", props.schedules.length);
  console.log("data", props.schedules);
  console.log("data type", typeof props.schedules);

  const [scheduleArray, setScheduleArray] = useState([]);

  useEffect(() => {
    console.log("props length", props.schedules.length);
    setScheduleArray(props.schedules);
  }, []);

  return (
    <div>
      <h2>Schedules</h2>
      <h3>this is weird</h3>
      {scheduleArray && scheduleArray.length > 0 ? (
        <ul>
          {props.schedules.map((schedule, index) => (
            <li key={index}>{schedule.name}</li>
          ))}
        </ul>
      ) : (
        <p>No schedules found.</p>
      )}
    </div>
  );
}

export default ScheduleList;

